import React from 'react';
import Header from '../Header';
import { Box } from '@chakra-ui/core';
import Menu from '../Menu';
import Dashboard from '../../views/Dashboard';

const Main = () => {
    return (
        <Box
            bg="gray.100"
        >
            <Header />
            <Box
                w={0.9}
                m="-40px auto"
            >
                <Menu />
            </Box>
            <Dashboard />
            <Box p="10px" />
        </Box>
    )
}

export default Main;
